//Pages

import Navbar from "./components/Navbar";
import Home from "./pages/HomePage/Home";
import Dashboard from "./pages/DashBoard/Main/dashboard";
import Appointment from "./pages/DashBoard/Appointments/appointment";
import Login from "./pages/Login/Login";
import Aboutus from "./pages/AboutUs/aboutus";
import Cars from "./pages/DashBoard/Cars/cars";
import Settings from "./pages/DashBoard/Settings/settings";
import NotFound from "./pages/NotFound/404";
import Users from "./pages/DashBoard/Users/users";

//
import "./app.css";


import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import { useEffect, useState } from "react";
import { useParams } from 'react-router-dom';

const App = () => {
  const [user, setUser] = useState(null);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const getUser = () => {
      const timeoutId = setTimeout(() => {
        setIsLoading(false);
        console.log('Request timed out');
      }, 2000);

      fetch("http://localhost:5000/auth/login/success", {
        method: "GET",
        credentials: "include",
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
          "Access-Control-Allow-Credentials": true,
        },
      })
        .then((response) => {
          clearTimeout(timeoutId);
          if (response.status === 200) return response.json();
          throw new Error("authentication has been failed!");
        })
        .then((resObject) => {
          setUser(resObject.user);
          setIsLoading(false);
        })
        .catch((err) => {
          console.log(err);
          setIsLoading(false);
        });
    };
    getUser();
  }, []);;
  if (isLoading) {
    return <div></div>;
  }
  return (
    <BrowserRouter>
      <div>
        <Navbar user={user} />
        <Routes>
        <Route path="/" element={<Home user={user} />} />
        <Route path="/aboutus" element={<Aboutus/>} />
          <Route
            path={`/dashboard/${user?.googleId}`}
            element={user ? <Dashboard  user={user} /> : <Login />}
          />
          <Route
            path={`/dashboard/appointment/${user?.googleId}`}
            element={user ? <Appointment user={user} /> : <Login />}
          />
          <Route
            path={`/dashboard/settings/${user?.googleId}`}
            element={user ? <Settings user={user}/> : <Login />}
          />
          <Route path={`/dashboard/cars/:googleId`} element={user ? (useParams().googleId === user.googleId ? <Cars user={user}/> : <NotFound />) : <Login />}
          />
          <Route
            path={`/dashboard/admin/users`}
            element={
              user 
                ? (user.rank === 'Admin' 
                    ? <Users user={user}/> 
                    : <NotFound />) 
                : <Login />
            }
          />
          <Route
            path="/login"
            element={user ? <Navigate to="/" /> : <Login />}
          />
          <Route
            path="*"
            element={<NotFound />}
          />
        </Routes>
      </div>
    </BrowserRouter>
  );
};

export default App;
